from sys import stdin

def main():
    x1, x2, x3 = [int(x) for x in stdin.readline().strip().split()]
    xs = {x1, x2, x3}
    if len(xs) == 1:
        print(x1 // 3, x1 // 3, x1 // 3)
    elif len(xs) == 2:
        print(x1 // 2, x1 // 2, x2 // 2)
    elif len(xs) == 3:
        xs = sorted(xs)
        print(xs[0] - xs[1], xs[1] - xs[2], xs[2])
    else:
        xs = sorted(xs)
        print(xs[1] - xs[0], xs[2] - xs[1], xs[3] - xs[2])


if __name__ == '__main__':
    main()

